import React from 'react';
import './matchData.css';
import { Container, Grid, Segment, Header, Divider, Button, Icon, Image, Item, Label } from 'semantic-ui-react';
import MatchCard from './matchCard';

const premLogo = "data:image/png;base64,"

const MatchData = () => ( 
    <Container style={{
        background: 'white', 
        borderStyle: 'solid', 
        borderColor: '#37003C', 
        borderWidth: '3px', 
        borderRadius: '8px', 
        margin: '80px', 
        padding: '10px'
        }}>
        <div>
            <Segment style={{margin: '15px'}} textAlign='center'>
                <Header>
                    Gameweek 15
                </Header>
                <Image style={{display: 'block', marginLeft: 'auto', marginRight: 'auto'}} src={premLogo}></Image>
            </Segment>
            <MatchCard/>
        </div>
    </Container>
)

export default MatchData;
